import React, { Component } from 'react';
import './universityList'
import UniversityCard from '../universityCard'
function UniversityList(props) {
   const  { title, subTitle, universityArray } = props ;
    return <div>
        {title && <div>{title}</div>}
        {subTitle && <div>{subTitle}</div>}
        {universityArray && universityArray.map((university,index) => <UniversityCard {...university} key={index}/>)}
    </div>

}
export default UniversityList;
